import {useState} from 'react'

function EditUser({ currentUsername }) {
  return (
    <div className="EditUser">
      <h3>Edit User:</h3>
      <input 
        className="EditUserInput"
        defaultValue={currentUsername}>

      </input>
    </div>
  )
}

export default EditUser
